//Create arrow function
const Counter = () => {
    let count = 0;

    const handleIncrement = () =>{
        count++;
    }
    return(
        <div>
            <p>The count is:</p>
            <button onClick={handleIncrement}>Increment</button>
            <button>Decrement</button>

        </div>
    )
};

export default Counter;
